class Solution {
    fun accountBalanceAfterPurchase(purchaseAmount: Int): Int {
        // Find the nearest multiple of 10. If there is a tie, choose the larger one.
        val roundedAmount = if (purchaseAmount % 10 == 0) purchaseAmount
                            else ((purchaseAmount / 10) + 1) * 10

        // Subtract the rounded amount from the initial balance and return the result
        return 100 - roundedAmount
    }
}
